import React, { useState } from 'react';
import '../../App.css';
// import Cards from '../Cards';
import HeroSection from '../photoComponents/HeroSection';
import Footer from '../photoComponents/Footer';
import ImageGrid from '../photoComponents/ImageGrid';
import Modal from '../photoComponents/Modal';
// import UploadForm from '../photoComponets/UploadForm';


function Home() {
  const [selectedImg, setSelectedImg,] = useState(null);


  return (
    <>
      <HeroSection />
      {/* <Cards /> */}
      {/* <UploadForm/> */}
      <ImageGrid setSelectedImg={setSelectedImg} />
      {selectedImg && <Modal selectedImg={selectedImg} setSelectedImg={setSelectedImg} />}
      <Footer />
    </>
  );
}

export default Home;
